import './App.css';
import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Home from './components/home';

// import {Link} from 'react-router-dom';


const App = () => {
  return(
    <div id='app'>
      {/* <BrowserRouter> */}
      <Routes>
        <Route path='/' element={<Home />}></Route>
      </Routes>
      {/* </BrowserRouter> */}


    </div>
  );
}

export default App;
